import React from 'react';
import './Line.css';
import { gsap, Power2 } from 'gsap';

// Line Avtar 
export default function REturnLine() {

 React.useEffect(() => {
  gsap.from('.wrp-line-profil', { duration: 1.4, delay: 1, opacity: 0, width: '27vw', ease: Power2.easeOut })

 }, []);

 return (
  <div className='wrp-line-profil'></div>
 );
};
